Diamond is the author of a new book that takes female empowerment too far. Jordan catches a commercial about Diamonds book that talks about the negative impact it has had on relationships. It turns out that Jordan's wife read Diamonds book and leaves him immediately. Jordan's sadness quickly turns to anger, and her decides to pay a visit to Diamond's office to express his anger on her asshole.
